import{_ as a,c as e,o as t,a1 as o}from"./chunks/framework.BwTyoF0R.js";const q=JSON.parse('{"title":"项目任务","description":"","frontmatter":{},"headers":[],"relativePath":"基础面试-wiki/13-教学互动/练习环节/01-项目任务.md","filePath":"基础面试-wiki/13-教学互动/练习环节/01-项目任务.md"}'),r={name:"基础面试-wiki/13-教学互动/练习环节/01-项目任务.md"},p=o('<h1 id="项目任务" tabindex="-1">项目任务 <a class="header-anchor" href="#项目任务" aria-label="Permalink to &quot;项目任务&quot;">​</a></h1><blockquote><p>浅层学习看输入，深度学习看输出</p></blockquote><h2 id="第2章-面试前的准备" tabindex="-1">第2章 面试前的准备 <a class="header-anchor" href="#第2章-面试前的准备" aria-label="Permalink to &quot;第2章 面试前的准备&quot;">​</a></h2><p><strong>【任务】写一个自己的简历</strong></p><p>试着写一下自己当前的简历，无论你是否正在打算找工作。</p><p>写简历可以让你总结、复盘当前自己的技术水平，看看自己有多少能拿的出手的技能和项目经验。 如果感觉目前还有不足，可即使学习补充，下次面试就能用得上。</p><h2 id="第3章-css-面试题" tabindex="-1">第3章 CSS 面试题 <a class="header-anchor" href="#第3章-css-面试题" aria-label="Permalink to &quot;第3章 CSS 面试题&quot;">​</a></h2><p><strong>【任务】总结 CSS 面试题</strong></p><p>写一篇博客，总结本章的学习成果，记录常见的 CSS 面试题。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第4章-js基础-变量类型和计算" tabindex="-1">第4章 JS基础-变量类型和计算 <a class="header-anchor" href="#第4章-js基础-变量类型和计算" aria-label="Permalink to &quot;第4章 JS基础-变量类型和计算&quot;">​</a></h2><p><strong>【任务】默写 JS 深拷贝</strong></p><p>学完本章之后，不参考任何资料，默写 JS 深拷贝。</p><p>以博客形式输出，即写一篇博客记录 JS 深拷贝的实现过程，和代码解读。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第5章-js基础-原型和原型链" tabindex="-1">第5章 JS基础-原型和原型链 <a class="header-anchor" href="#第5章-js基础-原型和原型链" aria-label="Permalink to &quot;第5章 JS基础-原型和原型链&quot;">​</a></h2><p><strong>【任务】画图解释原型链</strong></p><p>学完本章之后，不参考任何资料，自己画一个原型链的图示，并配合代码。</p><p>以博客形式输出，即写一篇博客讲解图和代码。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第6章-js基础-作用域和闭包" tabindex="-1">第6章 JS基础-作用域和闭包 <a class="header-anchor" href="#第6章-js基础-作用域和闭包" aria-label="Permalink to &quot;第6章 JS基础-作用域和闭包&quot;">​</a></h2><p><strong>【任务】总结闭包的使用场景</strong></p><p>写一篇博客，总结闭包的使用场景，并写 demo 解释。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第7章-js基础-异步" tabindex="-1">第7章 JS基础-异步 <a class="header-anchor" href="#第7章-js基础-异步" aria-label="Permalink to &quot;第7章 JS基础-异步&quot;">​</a></h2><p><strong>【任务】初识 Promise</strong></p><p>如果你是 JS 新手，可写一篇博客来记录你对 Promise 的任务。如果你对 Promise 比较熟悉，可忽略。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第8章-js-异步进阶" tabindex="-1">第8章 JS 异步进阶 <a class="header-anchor" href="#第8章-js-异步进阶" aria-label="Permalink to &quot;第8章 JS 异步进阶&quot;">​</a></h2><p><strong>【任务】画图解释 event loop</strong></p><p>学完本章，自己画图（不要截课程的图）解释 event loop 过程。</p><p>以博客形式输出，即写一篇博客解释 event loop 的过程，结合你画的图。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><p><strong>【任务】总结宏任务和微任务</strong></p><p>写一篇博客，总结宏任务和微任务，作为学习笔记。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第9章-js-web-api-dom" tabindex="-1">第9章 JS-Web-API-DOM <a class="header-anchor" href="#第9章-js-web-api-dom" aria-label="Permalink to &quot;第9章 JS-Web-API-DOM&quot;">​</a></h2><p>暂无（内容少，而且很简单）</p><h2 id="第10章-js-web-api-bom" tabindex="-1">第10章 JS-Web-API-BOM <a class="header-anchor" href="#第10章-js-web-api-bom" aria-label="Permalink to &quot;第10章 JS-Web-API-BOM&quot;">​</a></h2><p>暂无（内容少，而且很简单）</p><h2 id="第11章-js-web-api-事件" tabindex="-1">第11章 JS-Web-API-事件 <a class="header-anchor" href="#第11章-js-web-api-事件" aria-label="Permalink to &quot;第11章 JS-Web-API-事件&quot;">​</a></h2><p>暂无（内容少，而且很简单）</p><h2 id="第12章-js-web-api-ajax" tabindex="-1">第12章 JS-Web-API-Ajax <a class="header-anchor" href="#第12章-js-web-api-ajax" aria-label="Permalink to &quot;第12章 JS-Web-API-Ajax&quot;">​</a></h2><p><strong>【任务】介绍跨域请求</strong></p><p>写一篇博客，介绍跨域请求的前生今世，包括浏览器同源策略，和跨域的实现方式。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第13章-js-web-api-存储" tabindex="-1">第13章 JS-Web-API-存储 <a class="header-anchor" href="#第13章-js-web-api-存储" aria-label="Permalink to &quot;第13章 JS-Web-API-存储&quot;">​</a></h2><p>暂无（内容少，而且很简单）</p><h2 id="第14章-http-面试题" tabindex="-1">第14章 http 面试题 <a class="header-anchor" href="#第14章-http-面试题" aria-label="Permalink to &quot;第14章 http 面试题&quot;">​</a></h2><p><strong>【任务】总结 http 缓存策略</strong></p><p>写一篇博客，总结你对 http 缓存策略的学习成果，作为学习笔记。尽量详细写，图文并茂的解释清楚。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第15章-开发环境" tabindex="-1">第15章 开发环境 <a class="header-anchor" href="#第15章-开发环境" aria-label="Permalink to &quot;第15章 开发环境&quot;">​</a></h2><p><strong>【任务】总结 linux 常用命令</strong></p><p>写一篇博客，总结 linux 常用命令，作为学习笔记。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第16章-运行环境" tabindex="-1">第16章 运行环境 <a class="header-anchor" href="#第16章-运行环境" aria-label="Permalink to &quot;第16章 运行环境&quot;">​</a></h2><p><strong>【任务】手写 debounce 和 throttle</strong></p><p>学完本章之后，自己默写 debounce 和 throttle ，不要照抄。</p><p>以博客形似输出，即写一篇博客，分析 debounce 和 throttle 的源码和使用。</p><p>博客写完后，将链接发到课程 QQ 群，分享给其他同学。相互学习，相互评论，相互点赞。</p><h2 id="第17章-课程总结" tabindex="-1">第17章 课程总结 <a class="header-anchor" href="#第17章-课程总结" aria-label="Permalink to &quot;第17章 课程总结&quot;">​</a></h2><p>无</p><h2 id="第18章-真题模拟" tabindex="-1">第18章 真题模拟 <a class="header-anchor" href="#第18章-真题模拟" aria-label="Permalink to &quot;第18章 真题模拟&quot;">​</a></h2><p>无</p>',65),s=[p];function i(h,n,l,d,b,c){return t(),e("div",null,s)}const S=a(r,[["render",i]]);export{q as __pageData,S as default};
